So excited for everyone to hear the deep understanding of social, religious and cultural systems and the knowledge of inner-work that Sohail has to share. 

“Doing the inner work of healing our shadows and traumas is so important to being able to take that next step for the evolution of both the planet and for ourselves. We are the microcosm of the universe and so if we are not able to heal ourselves, then we cannot help heal Mother Earth. 

Shadow work and trauma work both require a receptivity, a feminine quality of feeling and being in touch with deeper dimensions of ourselves that are not part of the collective consciousness. Once we can tap into this, we can start to see the depth of the pain we have been experiencing.

We have to be able to look the darkness in the eye instead of pushing it aside. This takes real inner strength which we all have but sometimes we just choose not to access that power. Once we do this, certain blocks in our being get removed and the energy can then flow more freely both for ourselves and for Mother Earth as a whole.”
